import styled from 'styled-components'

const Container = styled.div`
     position: relative;
     margin-left:700px;
`
const Btn = styled.button`
  padding: 12px;
  border: none;
  border-radius: 4px;
  margin: 5px 0;
  opacity: 0.85;
  
  font-size: 17px;
  line-height: 20px;
  text-decoration: none;
`
const HeadTitle = styled.h1` 
     color:#46A358 ;
     font-family:'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
     font-size: 25px;
     font-weight: 600;
     line-height: 1.24;
     text-align: center;
     z-index: 10;
     margin: 0;

`

const Inputtype = styled.input`
   
  padding: 12px;
  border: none;
  border-radius: 4px;
  margin: 5px 0;
  opacity: 0.85;
  
  font-size: 17px;
  line-height: 20px;
  text-decoration: none;
`
const Textcontainer = styled.div`
  display: flex;
  
`
const Div = styled.div`
  display: block;
  padding: 0.8em 0em 0.8em 0em;
  color:#fff;
  font-size:13px;

  
`

export {Container,Btn,HeadTitle,Inputtype,Textcontainer,Div}
